// this line should not be removed
var wLayoutAdd = angular.module("wLayoutAdd",[]);

wLayoutAdd.controller( "wLayoutAddController", function( $scope ) {

    $scope.gettabItems = function() {
        var dq = new DataQuery( 'qGetUsersTab' );
        dq.execute().
        	done( function() {
        		$scope.$apply(function() {
        			$scope.tab_data = dq.getData();
        		});
	});

    };
    $scope.getpanelItems = function() {
        var dq = new DataQuery( 'qGetUsersPanel' );
        dq.execute().
        	done( function() {
        		$scope.$apply(function() {
        			$scope.panel_data = dq.getData();
        		});
	});

    };
    $scope.getaccordionItems = function() {
        var dq = new DataQuery( 'qGetUsersAccordion' );
        dq.execute().
        	done( function() {
        		$scope.$apply(function() {
        			$scope.accordion_data = dq.getData();
        		});
	});

    };
    $scope.getlistItems = function() {
        var dq = new DataQuery( 'qGetUsersList' );
        dq.execute().
        	done( function() {
        		$scope.$apply(function() {
        			$scope.list_data = dq.getData();
        		});
	});

    };


    $scope.gettabItems();
    $scope.getaccordionItems();
    $scope.getpanelItems();
    $scope.getlistItems();
    $scope.LayoutAdd = function(arg){


          var dq = new DataQuery( 'qAddUser' );

        dq.setReqBody({
                "id": $scope.id_mdl,
                "firstName": $scope.first_mdl,
                "lastName": $scope.last_mdl,
                "occupation":$scope.occupation_mdl
        });

        dq.execute().
        done( function() {
                $scope.$apply(function() {
                        console.log('insert done');
                        $scope.crudGet();
                });
        });
        $scope.gettabItems();
        $scope.getaccordionItems();
        $scope.getpanelItems();
        $scope.getlistItems();
    };




});
